import React from 'react';

const Projects = () => {
    return (
        <section id="projects">
            <h2>Projects</h2>
            <div className="projects-list">
                <div className="project">
                    <h3>Project 1</h3>
                    <p>Description of Project 1</p>
                </div>
                <div className="project">
                    <h3>Project 2</h3>
                    <p>Description of Project 2</p>
                </div>
                <div className="project">
                    <h3>Project 3</h3>
                    <p>Description of Project 3</p>
                </div>
            </div>
        </section>
    );
};

export default Projects;
